import React from "react";

import Divider from "@material-ui/core/Divider";
import Typography from "@material-ui/core/Typography";

import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  mainTitle: {
    variant: "h3",
    fontWeight: "bold",
  },
  title: {
    fontSize: 18,
    paddingBlock: "15px",
    fontWeight: "bold",
  },
  sub: {
    fontSize: 14,
    color: "textSecondary",
    paddingBottom: "30px",
  },
});

export default function Wallet() {
  const classes = useStyles();

  return (
    <div>
      <div>
        <Typography className={classes.mainTitle}>Wallet details</Typography>
        <Typography className={classes.title} gutterButtom>
          Address:
        </Typography>
        <Typography className={classes.sub} gutterButtom>
          tempAddress
        </Typography>
        <Typography className={classes.title} gutterButtom>
          Balance:
        </Typography>
        <Typography className={classes.sub} gutterButtom>
          tempBalance
        </Typography>
        <Divider />
      </div>
      <div>
        <Typography variant="h3" gutterButtom styles={{ fontWeight: "bold" }}>
          Transactions
        </Typography>
      </div>
    </div>
  );
}
